import { useState } from "react";
import DataService from "./services/tutorial.service";

const  App = () =>  {
  const temp: any = [];
  const [tableData, setTableData] = useState(temp);
  const [loading, setLoading] = useState(true);
  const [visible, setVisible] = useState(false);

  const getData = () => {
    setVisible(true);
    setLoading(true);
    DataService.getAll("http://algotraders.pythonanywhere.com/webDev/")
    .then(response => {
      console.log(response);
     setTableData(response.data);
     setLoading(false);
    })
    .catch(e => {
      console.log(e);
    });
}


  return (
    <div className="p-3 flex-col gap-y-2">
      <div className="flex justify-center">
      <button className="bg-gray-500 rounded text-white p-3" onClick={() => getData()}>Load Data</button>
      </div>
    { visible && 
        loading ? 
          <tr><td>loading...</td></tr>
         :
        <table className="w-screen border-2">
        <thead></thead>
        <tbody>
        {
          tableData.Matrix.map((dataArray: any, i: number) => {
            return (
              <tr key={i}>
                {dataArray.map((number: string, j: number) => {
                  console.log(tableData)
                  return (
                    <td className="p-2 border-2" key={i+1*j}>
                      {(
                      parseInt(number) / parseInt(tableData.Constant + "")
                      ).toPrecision(2)}
                    </td>
                  );
                })}
              </tr>
            );
          })
        }
         </tbody>
      </table>


        }
    </div>
  );
}

export default App;
